descr:
Fica a pessoa física intimada a:
01-Apresentar certificado de conformidade do corpo de bombeiros atualizado;
02-Corrigir avarias na tomada de energia do laboratorio de protese;
03-Melhorar limpeza e organização do laboratorio de proteses;
04-Corrigir infiltrações nas paredes do laboratorio de protese;
05-Retirar objetos olheios dos ambientes;
06-Retirar varal do laboratório de protese.
